import React, { Component } from "react";
import { prices } from "../constants/Prices";
import "../App.css";

const Liked = (props) => {
    const likedList =
    props.heart &&
    props.heart.map((item) => {
      return (
        <div>
          {item.quantity > 0 && (
            <div className="cart-item">
              <img src={item.img} style={{ height: 80}} />
              <p>{item.name}</p>
              <p>{item.size}</p>
              <p>${prices[item.id]}</p>
              <p>

              </p>
              <p>${prices[item.id] * item.quantity}</p>

            </div>
          )}
        </div>
      );
    });
    return (
        <div>
          <h1>Liked</h1>
          <div>{likedList}</div>
        </div>
    )
}


export default Liked;
